import React from 'react';
import styled from 'styled-components';

function ProfileLevel1(props) {
	return (
		<ComponentWrapper>
			<div className="MatchUpForm Form_className__zPqfI BasicInformation_className__DN3Ge is-kr is-confirm">
				<header className="Form-header">
					<dl className="Form-title">
						<dt>기본정보 수정</dt>
						<dd>
							지원 결과 또는 추천 포지션 정보를 받아볼
							이메일/연락처 정보 입력해주세요.
						</dd>
					</dl>
				</header>
				<div className="FormBlock Block_className__Y0A0N">
					<div className="FormBlock-content content">
						<label
							htmlFor="name"
							className="Input_className__dLoPc"
						>
							<h6>이름</h6>
							<input
								id="name"
								type="text"
								autoComplete="off"
								value="이해찬"
							/>
						</label>
						<label
							htmlFor="email"
							className="Input_className__dLoPc"
						>
							<h6>이메일</h6>
							<input
								id="email"
								type="email"
								autoComplete="off"
								value="cksgodl1@naver.com"
							/>
						</label>
						<div className="BasicInformation-mobile-wrapper BasicInformation_className_mobileConfirm__LY4oc is-kr">
							<label
								htmlFor="mobile"
								className="Input_className__dLoPc"
							>
								<h6>휴대폰 번호</h6>
								<input
									id="mobile"
									type="text"
									autoComplete="off"
									value="+821026972321"
								/>
							</label>
							{/* <button
								type="button"
								className="style_wrapper__IgK7U is-ghost"
							>
								<p>인증된 번호</p>
								<span className="SvgIcon_SvgIcon__root__8vwon">
									<svg
										className="SvgIcon_SvgIcon__root__svg__DKYBi"
										viewBox="0 0 15 15"
									>
										<defs>
											<path
												id="al3je9dvha"
												d="M576.95 196.13c-.217-.217-.57-.217-.787 0-.217.218-.217.57 0 .788l3.71 3.71c.217.217.57.217.787 0l6.677-6.678c.217-.217.217-.57 0-.787-.217-.217-.57-.217-.787 0l-6.284 6.284-3.316-3.316z"
											/>
										</defs>
										<g
											fill="currentColor"
											fillRule="evenodd"
										>
											<g transform="translate(-575 -192)">
												<use
													fill="#3366FF"
													fillRule="nonzero"
													stroke="#FFF"
													strokeWidth=".3"
													xlinkHref="#al3je9dvha"
												/>
											</g>
										</g>
									</svg>
								</span>
							</button> */}
						</div>
					</div>
				</div>
				<footer className="FormFooter Footer_className__0wFnB isChild">
					<button
						type="button"
						disabled=""
						className="BasicInformation-submit"
						data-attribute-id="profile__next"
						data-step="1"
					>
						완료
					</button>
				</footer>
			</div>
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	.Form_className__zPqfI {
		padding: 41px 0 30px;
		border: 1px solid #e1e2e3;
		border-radius: 3px;
		background-color: #fff;
	}
	.Form-header {
		padding-right: 30px;
		padding-left: 30px;
		dt {
			color: #333;
			font-size: 20px;
			font-weight: 600;
			line-height: 1;
		}
		dd {
			margin-top: 18px;
			color: #9a9a9a;
			font-size: 16px;
			font-weight: 400;
			line-height: 1.8;
		}
	}
	.FormBlock {
		margin-top: 43px;
	}
	.FormBlock-content {
		padding-right: 30px;
		padding-left: 30px;
	}
	.Input_className__dLoPc {
		width: 100%;
		display: block;
		position: relative;
		padding: 15px 0;
		h6 {
			top: 30px;
			left: 0;
			width: 150px;
			position: absolute;
			color: #999;
			font-size: 16px;
		}
		input {
			border: none;
			border-bottom: 1px solid #e1e2e3 !important;
			width: calc(100% - 150px);
			padding: 12px 0;
			margin-left: 150px;
			color: #333;
			font-size: 16px;
			outline: none;
			font-weight: 400;
			border-bottom: 1px solid #e1e2e3;
		}
	}
	.BasicInformation-mobile-wrapper button {
		width: 80px;
		height: 32px;
		position: absolute;
		top: 20px;
		left: 50%;
		padding: 6px;
		margin-bottom: 5px;
		border-radius: 5px;
		border-color: #e1e2e3;
		color: #666;
		font-size: 14px;
	}
	.BasicInformation_className_mobileConfirm__LY4oc span {
		display: block;
		width: 16px;
		height: 16px;
		margin-left: 5px;
		margin-top: 3px;
		margin-bottom: 0 !important;
	}
	.FormFooter {
		padding-right: 30px;
		padding-left: 30px;
		text-align: right;
		margin-top: 45px;
		button {
			width: 190px;
			height: 50px;
			border-radius: 3px;
			background-color: #258bf7;
			color: #fff;
			font-size: 18px;
			font-weight: 600;
			margin-left: 20px;
			:disabled {
				background-color: #ccc;
			}
		}
	}
`;
export default ProfileLevel1;
